// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.8.0; 
contract Auction{
    address public highestBidder; // The highest bidder's address
    uint256 public highestBid; // The amount of the highest bid

    mapping(address => uint256) public userBalances; // mapping for the amount to return

    constructor()  {
        highestBidder=msg.sender;
        highestBid=0;
    }

    /// Bid on the auction with the value sent
    /// together with this transaction.
    /// The value will only be refunded if the
    /// auction is not won.


    function bid() public payable {
        // 1. Check if the bid is greater than the current highest bid
        // 2. Update status variable and the amount to return
	uint current_bid;
	current_bid = msg.value;
        require(current_bid >= highestBid,"A higher bid already exists!");
        userBalances[highestBidder]=highestBid;
        highestBidder=msg.sender;
        highestBid=msg.value;
    }

    function withdraw() external payable returns(bool) {
        // Function to withdraw the amount of bid to return
        // 1. Check if the amount to return is greater than zero
        // 2. Update status variable and return bid
        uint amount;
        /*if (amount > 0) {
            [msg.sender] = 0;
            if (!payable(msg.sender).send(amount)) {
                userBalances[msg.sender] = amount;
                return false;
            }
        }*/
        bool with_res;

        require(msg.sender != highestBidder,"Highest Bidder can't withdraw!");

        amount = userBalances[msg.sender];

        require(amount > 0, "Withdraw amount  should be greater than zero!");



        with_res = payable(msg.sender).send(amount);
        userBalances[msg.sender] = 0;
        return with_res;
    }

    function getContractBalance() public view returns(uint){
        return address(this).balance;
    }

    function getAccountBalance(address _bidder) public view returns(uint){
        return address(_bidder).balance;
    }

    function isTheHighestBidder()public view returns(bool){
        if(msg.sender == highestBidder){
            return true;
        }
        return false;
    }


    receive() external payable {}
}
